import React from 'react';
import TrendList from '../components/TrendList';

const ExplorePage = () => {
  return (
    <div className="explore-page">
      <div className="container">
        <div className="row">
            <TrendList />
        </div>
      </div>
    </div>
  );
};

export default ExplorePage;
